import styled from "styled-components";

const Intro = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
`;

function Start() {
  return (
    <Intro>
      <h1>Welcome to </h1>
      <h1> Baseball Data</h1>
    </Intro>
  );
}

export default Start;
